import React from 'react';

function CinemaCard({ sede, funciones }) {
  return (
    <div className="cinema-card">
      <h2>{sede}</h2>
      
      {Object.keys(funciones).map((key) => {
        const funcion = funciones[key];
        return (
          <div key={key} className="funcion-card">
            <p>Dimensión: {funcion.dimension}</p>
            <p>Categoría: {funcion.categoria}</p>
            <p>Fecha de Inicio: {new Date(funcion.fechaInicio).toLocaleDateString()}</p>
            <p>Hora de Inicio: {new Date(funcion.horaInicio).toLocaleTimeString()}</p>
            <p>Sala: {funcion.sala}</p>
            <p>Precio: ${funcion.precio}</p>
          </div>
        );
      })}
    </div>
  );
}

export default CinemaCard;
